  getInterrest = async () => {
    const token = await AsyncStorage.getItem("@token:key");
    const response = await api.getTagList(token);
    if (response.ok) {
      const array = response.data.Body;
      const newInterests = array.map(element => {
        return {
          name: element.tagsName,
          isSelected: false
        };
      });
      this.setState({
        idealTagList: newInterests
      });
    } else {
      //
    }
  };

  setInterestHastags = () => {
    try {
      let array = !!this.props.userDetails && this.props.userDetails.interestedHashtags;

      if (array.length > 0) {
        const newInterests = array.map(element => {
          // console.log("parsed array format", element, array.length)
          return {
            name: element,
            isSelected: true
          };
        });
        // console.log("parsed array newInterests", newInterests)
        this.setState({
          interestedHashtags: newInterests
        });
      }
    } catch (error) {
      console.log(error);
    }
  };

