const mapStateToProps = state => {
  return {
    loading: state.auth.loading,
    userDetails: state.auth.user
  };
};

const mapDispatchToProps = dispatch => {
  return {
    updateUserProfile: (profile, uri) => dispatch(AuthActions.updateUserProfile(profile, uri)),
    saveUserInfo: data => dispatch(AuthActions.setUserInfo(data)),
    getUserInfo: () => dispatch(AuthActions.getUserInfo())
  };
};

const EditProfileHoc = connect(
  mapStateToProps,
  mapDispatchToProps
)(WithLoaderStatus(EditProfileScreen));

export default withNamespaces(["common"], { wait: true })(EditProfileHoc);

